/* 투명 배경 및 스크롤바 숨김 */
        body, html {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            overflow: hidden; /* 스크롤바 숨기기 */
            background-color: transparent;
        }

        /* 로딩 스피너 스타일 */
        .spinner {
            width: 20px;
            height: 20px;
            border: 3px solid #e0e0e0; /* 바깥 원색상: 밝은 회색 */
            border-top: 3px solid #333; /* 회전하는 색상: 짙은 회색 */
            border-radius: 50%;
            animation: spin 1s linear infinite;
        }

        /* 회전 애니메이션 정의 */
        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }

